{
  "translationLines": [
    {
      "lineNumber": 79591,
      "originalJapaneseLine": "天満橋。",
      "translatedEnglishLine": "Tenmabashi."
    },
    {
      "lineNumber": 79592,
      "originalJapaneseLine": "今、ここが戦場になろうとしていた。",
      "translatedEnglishLine": "Right now, this place was about to become a battlefield."
    },
    {
      "lineNumber": 79593,
      "originalJapaneseLine": "大陸、ポルトガル――",
      "translatedEnglishLine": "Continent, Portugal—"
    },
    {
      "lineNumber": 79594,
      "originalJapaneseLine": "既に自由都市を占領した魔物大将軍ピサロ率いる",
      "translatedEnglishLine": "The demon general Pizarro, who had already occupied the free cities,"
    },
    {
      "lineNumber": 79595,
      "originalJapaneseLine": "魔軍がポルトガル付近の野営地に集結していた。",
      "translatedEnglishLine": "had gathered the demon army at a camp near Portugal."
    },
    {
      "lineNumber": 79596,
      "originalJapaneseLine": "「天満橋の様子はどうだ？」",
      "translatedEnglishLine": "\"How is the situation at Tenmabashi?\""
    },
    {
      "lineNumber": 79597,
      "originalJapaneseLine": "「はっ、準備は着々と進んでおります。",
      "translatedEnglishLine": "\"Yes, preparations are steadily progressing."
    },
    {
      "lineNumber": 79598,
      "originalJapaneseLine": "　またこのポルトガルにも自由都市中から",
      "translatedEnglishLine": "Also, from all the free cities, we have gathered"
    },
    {
      "lineNumber": 79599,
      "originalJapaneseLine": "　兵を集め、現在の総数は十万に」",
      "translatedEnglishLine": "soldiers here in Portugal, currently totaling one hundred thousand.\""
    },
    {
      "lineNumber": 79600,
      "originalJapaneseLine": "「順調。",
      "translatedEnglishLine": "\"Smooth."
    },
    {
      "lineNumber": 79601,
      "originalJapaneseLine": "　はははっ、怖いくらいに全ては順調だな」",
      "translatedEnglishLine": "\"Hahaha, everything is going so smoothly it's almost scary.\""
    },
    {
      "lineNumber": 79602,
      "originalJapaneseLine": "「……この手柄は誰にも渡さん。",
      "translatedEnglishLine": "\"...I won’t let anyone else have this credit."
    },
    {
      "lineNumber": 79603,
      "originalJapaneseLine": "　JAPANは俺のものにしてやるぞ」",
      "translatedEnglishLine": "Japan will be mine.\""
    },
    {
      "lineNumber": 79604,
      "originalJapaneseLine": "「さあ、準備を急がせろ」",
      "translatedEnglishLine": "\"Now, hurry up the preparations.\""
    },
    {
      "lineNumber": 79605,
      "originalJapaneseLine": "「ははっ！」",
      "translatedEnglishLine": "\"Haha!\""
    },
    {
      "lineNumber": 79606,
      "originalJapaneseLine": "残された戦いなどただの事後処理。",
      "translatedEnglishLine": "The remaining battles were just post-processing."
    },
    {
      "lineNumber": 79607,
      "originalJapaneseLine": "後は破壊と略奪だけすればいい分、",
      "translatedEnglishLine": "All that was left was to destroy and plunder,"
    },
    {
      "lineNumber": 79608,
      "originalJapaneseLine": "魔軍の兵達は晴れやかな活気に溢れていた。",
      "translatedEnglishLine": "so the soldiers of the demon army were filled with bright vigor."
    },
    {
      "lineNumber": 79609,
      "originalJapaneseLine": "一方――",
      "translatedEnglishLine": "Meanwhile—"
    },
    {
      "lineNumber": 79610,
      "originalJapaneseLine": "JAPAN、モロッコ――",
      "translatedEnglishLine": "Japan, Morocco—"
    },
    {
      "lineNumber": 79611,
      "originalJapaneseLine": "魔軍に対抗するように天満橋の",
      "translatedEnglishLine": "On the opposite side of Tenmabashi, to oppose the demon army,"
    },
    {
      "lineNumber": 79612,
      "originalJapaneseLine": "反対側にはJAPAN軍三万が展開していた。",
      "translatedEnglishLine": "the Japanese army of thirty thousand was deployed."
    },
    {
      "lineNumber": 79613,
      "originalJapaneseLine": "その前線にランス達がいた。",
      "translatedEnglishLine": "Lance and his comrades were at that frontline."
    },
    {
      "lineNumber": 79614,
      "originalJapaneseLine": "「ふーむ」",
      "translatedEnglishLine": "\"Hmm.\""
    },
    {
      "lineNumber": 79615,
      "originalJapaneseLine": "ランスが天満橋を睨むように眺めていた。",
      "translatedEnglishLine": "Lance stared at Tenmabashi as if glaring."
    },
    {
      "lineNumber": 79616,
      "originalJapaneseLine": "「このずーーーっと先に、",
      "translatedEnglishLine": "\"Far ahead over there,"
    },
    {
      "lineNumber": 79617,
      "originalJapaneseLine": "　魔軍共が詰めているのか」",
      "translatedEnglishLine": "the demon army is closing in, huh?\""
    },
    {
      "lineNumber": 79618,
      "originalJapaneseLine": "「大丈夫なんだろうな？」",
      "translatedEnglishLine": "\"It's going to be alright, right?\""
    },
    {
      "lineNumber": 79619,
      "originalJapaneseLine": "「大丈夫なようにする。",
      "translatedEnglishLine": "\"We'll make sure it is."
    },
    {
      "lineNumber": 79620,
      "originalJapaneseLine": "　それが俺達の仕事だ」",
      "translatedEnglishLine": "That's our job.\""
    },
    {
      "lineNumber": 79621,
      "originalJapaneseLine": "「ここを守り切って、なんとか押し返す。",
      "translatedEnglishLine": "\"We have to hold our ground here and somehow push them back."
    },
    {
      "lineNumber": 79622,
      "originalJapaneseLine": "　そうしなければ人類に未来はない」",
      "translatedEnglishLine": "If we don't, humanity has no future.\""
    },
    {
      "lineNumber": 79623,
      "originalJapaneseLine": "「なんとかするしかないだろうな」",
      "translatedEnglishLine": "\"We have no choice but to do something about it.\""
    },
    {
      "lineNumber": 79624,
      "originalJapaneseLine": "「で、連中、いつ頃攻めてくる？」",
      "translatedEnglishLine": "\"So, when will they attack?\""
    },
    {
      "lineNumber": 79625,
      "originalJapaneseLine": "「今日か、明日か、明後日か……」",
      "translatedEnglishLine": "\"Today, tomorrow, or the day after...\""
    },
    {
      "lineNumber": 79626,
      "originalJapaneseLine": "「そう遠くないかと。",
      "translatedEnglishLine": "\"I don’t think it will be too long."
    },
    {
      "lineNumber": 79627,
      "originalJapaneseLine": "　侵攻の準備が済み次第に来ますよ」",
      "translatedEnglishLine": "They will come as soon as their invasion preparations are complete.\""
    },
    {
      "lineNumber": 79628,
      "originalJapaneseLine": "「ふーむ……」",
      "translatedEnglishLine": "\"Hmm...\""
    },
    {
      "lineNumber": 79629,
      "originalJapaneseLine": "「ま、こっちには兵が沢山。",
      "translatedEnglishLine": "\"Well, we have plenty of soldiers here."
    },
    {
      "lineNumber": 79630,
      "originalJapaneseLine": "　天満橋は守りやすい場所だしな、",
      "translatedEnglishLine": "Tenmabashi is an easy place to defend,"
    },
    {
      "lineNumber": 79631,
      "originalJapaneseLine": "　なんとかなるだろ」",
      "translatedEnglishLine": "so we'll manage somehow.\""
    },
    {
      "lineNumber": 79632,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"............\""
    },
    {
      "lineNumber": 79633,
      "originalJapaneseLine": "「ん？　どした？」",
      "translatedEnglishLine": "\"Hmm? What's wrong?\""
    },
    {
      "lineNumber": 79634,
      "originalJapaneseLine": "「残念ながら、兵が沢山、とはいかなくてな」",
      "translatedEnglishLine": "\"Unfortunately, we don't have as many soldiers as that.\""
    },
    {
      "lineNumber": 79635,
      "originalJapaneseLine": "「本来なら妖怪軍団が総出で立ち上がり、",
      "translatedEnglishLine": "\"Originally, the entire youkai army was supposed to rise up,"
    },
    {
      "lineNumber": 79636,
      "originalJapaneseLine": "　魔軍の進行を防ぐ手筈だったのだが……」",
      "translatedEnglishLine": "to stop the demon army's advance, but...\""
    },
    {
      "lineNumber": 79637,
      "originalJapaneseLine": "「むむ、嫌な予感……なにがあった？」",
      "translatedEnglishLine": "\"Hmm, I have a bad feeling... What happened?\""
    },
    {
      "lineNumber": 79638,
      "originalJapaneseLine": "「妖怪の数が半分に減った」",
      "translatedEnglishLine": "\"The number of youkai has been cut in half.\""
    },
    {
      "lineNumber": 79639,
      "originalJapaneseLine": "「なにー！？　どういうことだ、そりゃ！」",
      "translatedEnglishLine": "\"What!? What do you mean by that!\""
    },
    {
      "lineNumber": 79640,
      "originalJapaneseLine": "「今までこの国に住む妖怪は俺が頭となり",
      "translatedEnglishLine": "\"Until now, I have been the leader of the youkai living in this country"
    }
  ]
}

